import React from 'react';

const Video_visuali = props => {
    return (
        <div>
            {props.videos.map(video => (
                <iframe src={`www.youtube.com/watch?v={video.id.videoId}`} frameborder="0"></iframe>    
            ))}

        </div>
    );
};

export default Video_visuali;
